import React from 'react';
import Tabs from '../../components/Tabs'
import Footer from '../../components/Footer'
import Dropdowns from '../../components/Dropdowns/Dropdowns';

class MainPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            activeTab: "",
            catagory: "",
            clothingDropdowns: false,
            nonClothingDropdowns: false,
            searchBarOn: false,
            graphOn: false,
            listOn: false
        }
    }

    triggerSetClothing = () => {
        this.setState({
            ...this.state,
            clothingDropdowns: true,
            searchBarOn: true,
        })
    }
    render() {
        return (
            <div>
                <div className="content">
                    <header>
                        <div className="bubbles cntr">
                            <h1>Pricing Tool</h1>
                        </div>
                    </header>
                    <div className="container">
                        <Tabs
                            setClothing={this.triggerSetClothing}
                            setNonClothing={this.triggerSetNonClothing}
                        />
                    </div>
                    {this.state.clothingDropdowns && <Dropdowns></Dropdowns>}
                </div>
                <Footer />
            </div>
        );
    }
}

export default MainPage;
